/**
 * @author [Alex Neo]
 * @email [alex.neo0115@gmail.com]
 * @create date 2022-01-12 18:08:03
 * @modify date 2022-01-12 18:08:03
 * @desc [create sider view]
*/

const addMenuItem = (payload) => {
    return {
        type: "ADD_MENU_ITEMS",
        payload: payload
    }
}

const increaseCounter = (id, data) => {
    return {
        type: "INCR_COUNTER",
        payload: { id, data }
    }
}

export{
    addMenuItem,
    increaseCounter
}
